import orderedActionTypes from "./ordered.types";

export const orderedSuccess = () => ({
  type: orderedActionTypes.ORDERED_SUCCESS,
});

export const orderedDetail = (ordered) => ({
  type: orderedActionTypes.ORDERED_DETAIL,
  payload: ordered,
});
